import React, { useState } from "react";
import "./index.css";
const Note = () => {

    const [name,setname]=useState('')
    const input=(e)=>{
        setname(e.target.value)
    }

  return (
    <>
      <div className="container">
        <div id="card">
          <h1>add hari</h1>
          <input onChange={input} placeholder="enter hari's name"></input>
          <button>+</button>
            <div id='output'>
                <button>-</button>
                <li>{name}</li>
            </div>
        </div>
      </div>
    </>
  );
};

export default Note;
